DROP DATABASE IF EXISTS `pictureTag`;
CREATE DATABASE `pictureTag` DEFAULT CHARACTER SET utf8;
USE `pictureTag`;

DROP TABLE IF EXISTS `pictureTag`;
CREATE TABLE `pictureTag` (
  `employeeId` VARCHAR(64) NOT NULL,
  `taskId` VARCHAR(64) NOT NULL,
  `pictureId` VARCHAR(64) NOT NULL,
  `tagId` VARCHAR(64) NOT NULL,
  `border` TEXT NOT NULL,
  `annotation` VARCHAR(255),
  PRIMARY KEY (`employeeId`,`taskId`,`pictureId`,`tagId`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `employeeTaskInfo`;
CREATE TABLE `employeeTaskInfo` (
  `employeeId` VARCHAR(128) NOT NULL,
  `taskId` VARCHAR(128) NOT NULL,
  `acceptTime` VARCHAR(128) NOT NULL,
  `finishTime` VARCHAR(128) NOT NULL,
  `completedPictureNum` INT(10),
  `totalPictureNum` INT(10),
  `completedPictureId` TEXT,
  `selectedPictureId` TEXT,
  `isFinished` BOOLEAN,
  `receiveAward` BOOLEAN,
  `reported` BOOLEAN,
  PRIMARY KEY (`employeeId`, `taskId`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `employerTaskInfo`;
CREATE TABLE `employerTaskInfo` (
  `employerId` VARCHAR(128) NOT NULL,
  `taskId` VARCHAR(128) NOT NULL,
  `neededEmployeeNum` INT(10) NOT NULL,
  `acceptedEmployeeNum` INT(10),
  `completedEmployeeNum` INT(10),
  `acceptedEmployeeId` TEXT,
  `completedEmployeeId` TEXT,
  `isFinished` BOOLEAN,
  PRIMARY KEY (`employerId`,`taskId`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `annotationJudgement`;
CREATE TABLE `annotationJudgement` (
  `employeeId` VARCHAR(128) NOT NULL,
  `taskId` VARCHAR(128) NOT NULL,
  `accuracy` DOUBLE,
  `efficiency` DOUBLE,
  `grade` DOUBLE,
  PRIMARY KEY (`employeeId`, `taskId`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `overallJudgement`;
CREATE TABLE `overallJudgement` (
  `employeeId` VARCHAR(128) NOT NULL,
  `accuracy` DOUBLE,
  `efficiency` DOUBLE,
  `grade` DOUBLE,
  PRIMARY KEY (`employeeId`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `employeeInfo`;
CREATE TABLE `employeeInfo` (
  `employeeName` VARCHAR(128) NOT NULL,
  `employeeId` VARCHAR(128) NOT NULL,
  `employeePassword` VARCHAR(128) NOT NULL,
  `employeeEmail` VARCHAR(128),
  `dpId` MEDIUMTEXT NOT NULL,
  `awardAmount` INT(10),
  `taskAmount` INT(10),
  `taskUnderway` INT(10),
  `taskCompleted` INT(10),
  `reportedTimes` INT(10),
  PRIMARY KEY (`employeeId`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `employerInfo`;
CREATE TABLE `employerInfo` (
  `employerName` VARCHAR(128) NOT NULL,
  `employerId` VARCHAR(128) NOT NULL,
  `employerPassword` VARCHAR(128) NOT NULL,
  `employerEmail` VARCHAR(128),
  `dpId` MEDIUMTEXT NOT NULL,
  `taskAmount` INT(10),
  `taskUnderway` INT(10),
  `taskCompleted` INT(10),
  PRIMARY KEY (`employerId`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `task`;
CREATE TABLE `task` (
  `isFull` BOOLEAN,
  `taskId` VARCHAR(128) NOT NULL,
  `taskName` VARCHAR(128) NOT NULL,
  `taskType` TEXT,
  `employerId` VARCHAR(128) NOT NULL,
  `releaseType` VARCHAR(128) NOT NULL,
  `startTime` VARCHAR(128) NOT NULL,
  `limitTime` VARCHAR(128) NOT NULL,
  `neededEmployeeAmount` INT(10) NOT NULL,
  `totalPictureAmount` INT(10) NOT NULL,
  `award` INT(10) NOT NULL,
  `overallPictureId` TEXT,
  `rectanglePictureId` TEXT,
  `boundaryPictureId` TEXT,
  `pictureAcceptedTimes` TEXT,
  `appointedEmployeeId` TEXT,
  `marks` VARCHAR(128),
  PRIMARY KEY (`taskId`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `picture`;
CREATE TABLE `picture` (
  `taskId` VARCHAR(128) NOT NULL,
  `pictureId` VARCHAR(128) NOT NULL,
  `base64Code` MEDIUMTEXT NOT NULL,
  PRIMARY KEY (`taskId`,`pictureId`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `standardResult`;
CREATE TABLE `standardResult` (
  `taskId` VARCHAR(64) NOT NULL,
  `pictureId` VARCHAR(64) NOT NULL,
  `tagId` VARCHAR(64) NOT NULL,
  `border` TEXT NOT NULL,
  `annotation` VARCHAR(255),
  PRIMARY KEY (`taskId`,`pictureId`,`tagId`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `employeeScore`;
CREATE TABLE `employeeScore` (
  `employeeId` VARCHAR(64) NOT NULL,
  `taskId` VARCHAR(64) NOT NULL,
  `pictureId` VARCHAR(64) NOT NULL,
  `score` DOUBLE NOT NULL,
  PRIMARY KEY (`employeeId`,`taskId`,`pictureId`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `message`;
CREATE TABLE `message` (
  `messageId` VARCHAR(64) NOT NULL,
  `userId` VARCHAR(64) NOT NULL,
  `releaseTime` DATE NOT NULL ,
  `title` VARCHAR(128),
  `content` VARCHAR(128),
  `isRead` BOOLEAN,
  PRIMARY KEY (`messageId`,`userId`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `examination`;
CREATE TABLE `examination` (
  `examId` VARCHAR(64) NOT NULL,
  `pictureId` VARCHAR(64) NOT NULL ,
  `border` TEXT NOT NULL,
  `annotation` VARCHAR(255),
  PRIMARY KEY (`examId`,`pictureId`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

